#Imran Qumtur


install.packages('gama')
install.packages('flexclust')
library(gama)
library(flexclust)
library(cluster)


#--------------Dataset 1 (Iris)--------------

data1 <- data.frame(iris)
data1_noLabel <- dataset1[,1:4]

data1_scaled <- data.frame(scale(data1_noLabel))

data1_classLabel <- iris$Species

              #-------K-means
km_data1 <- kmeans(data1_scaled,centers = 3, nstart = 20)

plot(data1[,1:4], pch = (km_data1$cluster), col = (km_data1$cluster))
plot(data1[,2:3], pch = (km_data1$cluster), col = (km_data1$cluster))

data1_km_sil <- silhouette(km_data1$cluster, dist(data1[,1:4],"euclidean"))
plot(data1_km_sil, main= "Dataset 1 K-means")
data1_km_silAvg<- print(mean(data1_km_sil[,3]))

data1_rand <- table(km_data1$cluster,data1_classLabel)
randIndex(data1_rand)

              #--------GA
ga_data1<-gama(data1_noLabel,3,fitness.criterion = "ASW", main = "Dataset 1 GA") 


plot(data1[,1:4], pch = (ga_data1@cluster), col = (ga_data1@cluster), main = "Dataset 1 GA")
plot(data1[,2:3], pch = (ga_data1@cluster), col = (ga_data1@cluster), main = "Dataset 1 GA")

data1_rand_ga <- table(ga_data1@cluster, data1_classLabel)
randIndex(data1_rand_ga)



